import LocalPhoneOutlinedIcon from '@mui/icons-material/LocalPhoneOutlined';
import FmdGoodOutlinedIcon from '@mui/icons-material/FmdGoodOutlined';
import axios from "axios";
import BasicSelect from "../../components/BasicSelect";
import { useContext, useEffect, useState } from "react";
import { AppContext } from "../../App";


function RegisterPhase2() {
  const navigate = useNavigate()
  const {districtsInTulungagung} = useContext(AppContext) 
  const [wards, setWards] = useState([]) 
  // setHandphoneNum, setDistricts, setWards, setAddressDetail
  const [handphoneNum, setHandphoneNum] = useState()
  const [districts, setDistricts] = useState()
  const [ward, setW] = useState()
  const [addressDetail, setAddressDetail] = useState()
  const [flag, setFlag]= useState(false)
  

  const handleChange = async(id) => {
    // setValue(event.target.value);
    const ward = await axios.get(`https://ibnux.github.io/data-indonesia/kelurahan/${id}.json`);
    console.log(ward.data, "VALL")
    setWards(ward.data)
};

