//   }
// };

  const handleWards = (val) => {

  }

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text="Daftar" />

      <Box sx={{ width: PADDING, display: "flex", flexDirection: "column" }}>
        <Box sx={{ mt: "32px" }}>
          <LogoMangan width="60px" height="60px" />
        </Box>
        <Box sx={{ mt: "32px" }}>
          <Typography
            sx={{
              fontSize: "16px",
              fontWeight: 600,
              color: THEME.BLACK_PRIMARY,
              marginBottom: "24px",
            }}
          >
            {REGISTER.MasukkanNomorDan}
          </Typography>
          <StyledTextField
            text={REGISTER.NomorTelepon}
            onChange={(e) => setHandphoneNum(e.target.value)}
            height="53px"
            icon={
              <LocalPhoneOutlinedIcon
                sx={{ width: "23px", height: "23px" }}
              />
            }
          />
          <BasicSelect data={districtsInTulungagung} onChange={(e) => setDistricts(e.target.value)} wardId={handleChange} marginTop="16px" type={"districts"}  label={"Kecamatan"} icon={<MailOutlineIcon sx={{ width: "21px", height: "21px" }} />}/>
          <BasicSelect data={wards} onChange={(e) => setWards(e.target.value)}  marginTop="16px" type={"wards"} label={"Kelurahan"} icon={<MailOutlineIcon sx={{ width: "21px", height: "21px" }}  />}/>
          <StyledTextField
            onChange={(e) => setAddressDetail(e.target.value)} 
            text="Detail Alamat"
            height="53px"
            icon={<MailOutlineIcon sx={{ width: "21px", height: "21px" }} />}
            marginTop="16px"
          />
        </Box>
        <StyledButton
          text={REGISTER.Daftar}
          marginTop="32px"
          style="fill"
          onClick={() => navigate("/home")}
        />
      </Box>
      {/* {districtsInTulungagung.map((i)=>{
        <Typography>{i}</Typography>
      })} */}
      {console.log("UDAH DIRENDER", wards)} 
    </Box>
  );
}

export default RegisterPhase2;
